import React, { useState, useEffect } from 'react';


const AuthorsList = () => {
  const [list, setList] = useState(null);

  useEffect(() => {
    getAuthorsList();
  }, []);

  const getAuthorsList = async () => {
    const response = await fetch("https://www.thequint.com/api/v1/authors");
    const data = await response.json();

    setList(data);

    console.log(setList);
  };

  return (
    <div className="story-list">
      {
        list && list.map((item, index) => <div key={index}> </div>)
      }
    </div>
  );
};
    
export default AuthorsList;
